webpackJsonp([0xcf8fc0e8534d],{302:function(e,t){e.exports={data:{post:{title:"Edition 2 (12/13/2017)",content:'<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Good morning, readers.<span style="color:#000000">&nbsp;</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Thank you for joining us for the second week of this Weekly Brief. For those new faces out there, we want to reiterate that this brief will cover market news mixed in with opinion, geared at a millennial audience. The material will vary from fundamentally educational to esoteric, but we will never provide actionable financial &quot;advice&quot; of any kind. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><strong><span style="color:#000000">Financial Literacy Lesson of the Week</span></strong></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><u><span style="color:#000000">Want Guaranteed Returns? Pay off Debt<span style="color:#000000">&nbsp;</span></span></u></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Let&#39;s face it, there are countless things you can do with your hard-earned money. Stocks, bonds, bitcoin, sports betting, or </span><a href="https://store.unionlosangeles.com/products/slight-oversized-plaid-shirt?variant=672532299785">this</a><span style="color:#000000"> $1,000 Raf Simons shirt that looks like a normal flannel. There are equally many ways to try to achieve a return in capital markets, and people are constantly inventing and creating new financial products to try and win over your money. However, from a personal finance perspective, there&#39;s only one way to achieve a </span><em><span style="color:#000000">guaranteed</span></em><span style="color:#000000"> return of any kind. How? Pay off your debt.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Let&#39;s think of a simple scenario. You have $10,000 of cash, and you&#39;re thinking about investing. But you also have a $10,000 student loan you haven&#39;t paid off yet. You pay interest at a rate of 4% annually on said loan. To complicate things, your parents have a money manager who oh-so-graciously agreed to talk to you for free about your finances, and he recommended investing at least some of your money in index funds that track the S&amp;P 500, because he thinks you&#39;ll achieve a <em>greater</em></span><span style="color:#000000"> than 4% return on that fund in 2018. While this money manager may end up being right, it&#39;s important to remember that any return you get on an investment in the market will be accompanied by commensurate risk. In the scenario you find yourself in, you would effectively be achieving a </span><em><span style="color:#000000">guaranteed</span></em><span style="color:#000000"> return of 4% by paying off your loan in full right away versus the alternative scenario in which you don&rsquo;t pay it off at all and invest instead. Does this mean you should always pay debt off before investing? No, the key lesson here is that absent opportunity costs, you need to adjust potential market returns for the risk that they carry.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">And if you&#39;re debt free? Congrats, you&#39;re far, far better off than </span><a href="https://www.cbsnews.com/news/most-americans-cant-afford-a-500-emergency-expense/">half</a><span style="color:#000000"> of your countrymen.&nbsp;<span style="color:#000000">&nbsp;</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><strong><span style="color:#000000">Goings on in the Market<strong><span style="color:#000000">&nbsp;</span></strong></span></strong></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><u><span style="color:#000000">ETFs (The Sedated Populace)</span></u></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Investors plowed more than $600 billion into exchange-traded funds globally in the first 11 months of the year, according to new research, already marking an annual record for one of Wall Street&rsquo;s hottest products.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Roughly 54% more cash flowed into ETFs through November than in all of 2016, according to London-based consulting firm ETFGI LLP. Assets in ETFs world-wide rose to $4.7 trillion at the end of November, up from $3.6 trillion at the end of last year.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">ETFs have gathered assets as many equities and other markets globally have marched steadily higher this year. The products have benefited from a growing preference among investors large and small for funds that track the performance of broad swaths of the market at a cheaper price.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><a href="https://www.wsj.com/articles/should-you-dump-your-broker-because-of-the-fiduciary-rule-1499652541" target="_blank">A new rule governing retirement advice</a><span style="color:#000000"> in the U.S. has also resulted in a shift among some financial advisers toward fee-based advice, further stoking ETFs&rsquo; rise. Advisers are increasingly building investment portfolios out of clusters of low-cost ETFs that offer exposure to different corners of the market.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">The 20 ETFs that have pulled in the most money this year accounted for 36% of the record net inflows and included several low-cost stock and bond funds, according to Deborah Fuhr, managing partner at ETFGI. The scale of the new money flowing into the products this year is more than 80% more than the same period last year.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">And the growth of ETFs has in some cases come at the expense of traditional stock and bond-picking; consulting firm McKinsey &amp; Co. estimates that in the last decade two thirds of ETF growth as a share of household financial assets came from money that was previously invested in individual securities.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">The popularity of the products has been a boon for large money managers like</span><a href="http://quotes.wsj.com/BLK" target="_blank"> BlackRock</a><span style="color:#000000"> Inc. and Vanguard Group, which boast the two largest lineups of ETFs by assets. BlackRock&rsquo;s ETFs alone attracted $239 billion in net new cash in the first 11 months of the year, according to ETFGI, while Vanguard&rsquo;s ETFs attracted a net $137.1 billion.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Some market watchers however are concerned about what this massive uptick in ETF buying and passive investing might mean for markets. While passive investing contributes to the earlier described phenomenon of driving volatility lower, it might also threaten the integrity of price discovery in markets. The term price discovery loosely refers to the process by which markets go up and down (as they typically do) and are constantly adjusting, negotiating, and settling on an accurate price for a given equity or instrument. This of course relies on every buyer and every seller making an actual determination regarding what a fair price is at any moment in time. How does this work for ETF buyers, who probably aren&rsquo;t taking the time to value every single component of the ETF they are buying, let alone making constant adjustments to their valuations? It probably doesn&rsquo;t, and this is leading some</span><a href="https://northmantrader.com/2017/11/22/the-silence-of-the-bears-2/" target="_blank"> market watchers</a><span style="color:#000000"> to consider the price discovery in current markets to be fundamentally broken. As James Grant, legendary interest rate watcher also notes: </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">&ldquo;The movement to indexation and to investing into ETFs has marginalized the securities analysts of the world. People don&rsquo;t believe that security analysis adds much value these days because one particular security in a big index is of no great importance. So another consequence, which is very much a financial one, is to dull the perception or to dull the responses of markets because they have been called to trust too much in the presence and in the action of central banks, certainly in Europe.&rdquo;</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">So who&rsquo;s fueling these huge inflows? To a large extent, people like you and me. Retail investors have been piling money into ETFs and other passive investment vehicles throughout the course of the year via funds provided by aforementioned companies like BlackRock and Vanguard. This comes at a time when some (notably Central Banks, such as our own) are considering that the inflows by institutions may have already over-inflated the value of the market.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Until then, the sky is the limit.&nbsp;<strong><span style="color:#000000">&nbsp;</span></strong></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><u><span style="color:#000000">Short Vol &ndash; The Hottest Name in the 2017 Game</span></u></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">If you spend any time perusing financial websites or watching CNBC, you&rsquo;ve probably realized that we have been in a bull market for some time now (one of the most pronounced since the 1800s), and that various different asset classes have been generating significant returns throughout 2017. The S&amp;P 500 - perhaps the most watched index - has returned approximately 17-18% year to date (YTD). If you had invested $100 on January 1st, 2017 in the S&amp;P 500 index, you would now have $117. Congrats, you can now have lunch thanks to the hard work of 500 of some of the top performing companies in world.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Returns in traditional bond and equity markets - while strong considering past performance - might not strike you as particularly sexy. Of course, if you&rsquo;re a lucky, early cryptocurrency investor - in Bitcoin for instance - you could be looking at a year to date return of over 1000%. That $100 we mentioned earlier could have added a zero at the end, and instead of lunch, you could pay off a slice of your parents&rsquo; mortgage for Christmas, though it might not be worth it when you have to actually explain what bitcoin <em>is</em></span><span style="color:#000000"> to them.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">But what if you&rsquo;re a major fund manager, and you <em>couldn&rsquo;t</em></span><span style="color:#000000"> have invested in bitcoin because there are specific rules set forth - by your fund - that delineate exactly what sorts of assets and vehicles you are allowed to invest your clients money in? Where have the really</span><em> </em><span style="color:#000000">big daddy returns been?</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">The answer lies in the short volatility trade, a topic we will now delve into in depth. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Volatility describes the liability of something to change rapidly, without respect to whether this change is up or down. For further context, it equates to the standard deviation in the movement of a security&rsquo;s price over a specified timeframe. The higher the volatility (or standard deviation), the higher the risk.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">When we describe an equity as volatile, we think more of tech stocks that might undulate multiple percentage points on a daily basis, or in the extreme case, lose nearly all of its value in a matter of weeks (see the example of </span><a href="http://money.cnn.com/galleries/2010/technology/1003/gallery.dot_com_busts/" target="_blank">Pets.com</a><span style="color:#000000"> during the 2000 tech crash). We don&rsquo;t, for contrast, think of U.S. treasury yields, for which </span><em><span style="color:#000000">basis point </span></em><span style="color:#000000">(1/100th of a percent) changes are tracked. Volatility as a term is also often used to describe broader market conditions. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Typically, only selling pressure in the market generates high volatility; when markets are moving up, volatility is typically low. And this has been exactly the case, and increasingly so, in the last 12 months, as markets domestically and globally have been on the rise. Broad market volatility, as measured by the VIX (more on this in coming weeks) has fallen and more importantly, remained consistently lower than ever (at least since the VIX was created to measure market volatility).</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">While we will do an in depth discussion of how the VIX works in future briefs, for now we will simply note that one of the most ubiquitous, crowded, and successful trades of 2017 has been to <em>short</em></span><span style="color:#000000"> volatility. In other words, asset managers and even individual investors everywhere are wagering that broad market volatility will continue to remain lower, and to consolidate even lower.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">To give substance to this discussion, let&#39;s mention that the VIX (which as we mentioned measures volatility in the broader market) now reads between 10-11 on a day to day basis. Historically it&rsquo;s usually higher, in the 15-20 ranges. As a result of the consistently falling VIX reading, financial products that allow investors to put on a short volatility trade without trading options or futures, such as the popular product from VelocityShares &ldquo;Daily Inverse VIX Short Term ETN&rdquo; (more on what the hell this is at a later date as well), have generated 100% + returns YTD. $XIV is the ticker for the above mentioned product, and it has returned 159% in the past 12 months.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">However, we must remember that outlandish returns are always accompanied by significant risk. How risky is this trade? History tells us <em>very</em></span><span style="color:#000000">. At the height of the bear market in 2009, the VIX printed a reading of 57.36. To put this in perspective, if the VIX jumped to 57.36 tomorrow on heightened market volatility, the product mentioned earlier ($XIV) would lose 80-90% of its value, wiping out most of the gains it accrued in this past year in a single day. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">So, if you are a Harvard alumnus, and I tell you that your alma mater&rsquo;s endowment recently allocated more than 1% of its assets into a short volatility vehicle, given the above risks, would you be concerned? This is purely subjective, but the risk for significant downside in short volatility products is significantly greater than that in traditional equities, bonds, real assets, etc&hellip;</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">The below image details Harvard&rsquo;s endowment&rsquo;s investment in $SVXY, a short volatility product</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><img alt="SVXY" src="data:image/png;base64," style="height:151px; width:623px" /></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Buyer beware!</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">To all our friends still in school, good luck on the sleepless, soul-crushing grind of finals week. To our friends in the real world: try not (or maybe try?) to get fired at this year&rsquo;s Holiday Party! Thank you for joining us, and more again next week. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Nick van Osdol</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Mark Grace</span></p>',
updated:"2018-02-10T20:17:32.377189Z",fields:{slug:"Edition-2",date:"(12/13/2017)"}}},pathContext:{slug:"Edition-2"}}}});
//# sourceMappingURL=path---edition-2-7f2aefdd4778f3799e1d.js.map